const BookList = ({ books }) => {
	return (
		<table className="book-list">
      <tbody>
  			{books.map((book) => (
          <tr>
    				<td><img className="book-cover" src={book.image}/></td>
    				<td><p>{book.title}</p></td>
            <td><p>by {book.author}</p></td>
    				<td><p>{book.rating}</p></td>
          </tr>
  			))}
      </tbody>
		</table>
	);
};

export default BookList;
